import React from 'react';
import MetaTags from 'react-meta-tags';

function MetaTagsHeader() {
    return (
        <MetaTags>
            <title>Andrea Pallotta</title>
            <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
            <meta name="description" content="Software Engineering Student"></meta>
            <meta name="keywords" content="HTML, CSS, JavaScript, Software, Software Engineering, Internship, coop, co-op, Java, React, ReactJS, Website"></meta>
            <meta name="author" content="Andrea Pallotta"></meta>
            <meta http-equiv="Content-Type" content="text/html; charset=ISO-8859-1"></meta>
            <meta name="viewport" content="width=device-width, initial-scale=1.0"></meta>
            <meta name="robots" content="noindex" />
            <META NAME="geo.position" CONTENT="latitude; longitude"></META>
            <META NAME="geo.placename" CONTENT="Rochester, NY"></META>
            <META NAME="geo.region" CONTENT="Country Subdivision Code"></META>
        </MetaTags>
    );
}

export default MetaTagsHeader;
